import { configureStore } from "@reduxjs/toolkit";
import { productsSlice } from "../pages/products/slices";

const rootReducer = {
    loginPage: loginSl,
    productsPage: productsSlice,
};

export const store = configureStore({
    reducer: rootReducer
});
